import styled from 'styled-components';

export const SharesDetailWrapper=styled.div`
    display: flex;
    flex-wrap: wrap;
`;

export const Details=styled.div`
    width: 33%;
    padding: 15px 20px 15px 0px;
`;

export const ValueTitle=styled.div`
  font-family: HelveticaNeue;
  font-size: 16px;
  line-height: 1.5;
  color: #505050;
`;

export const Value=styled.div`
  font-family: HelveticaNeue;
  font-size: 16px;
  font-weight: bold;
  line-height: 1.5;
  color: #022737;
`;

export const DescribeText = styled.p`
  font-family: BerkeleyStd;
  font-size: 20px;
  font-weight: 500;
  line-height: 1.3;
  letter-spacing: 0.5px;
  color: #006778;
  margin-bottom: 10px;
`;

export const GiftText=styled.a`
  display: block;
  /* text-decoration: block !important; */
  font-family: BerkeleyStd;
  font-size: 20px;
  font-weight: 500;
  line-height: 1.3;
  letter-spacing: 0.5px;
  color: #006778;
  margin-bottom: 10px;
`;

export const ActivityWrapper=styled.div`
  opacity: 0.9;
  border-bottom: solid 2px #d4d4d4;
`;
